import React from 'react';

const partners = [
  {
    name: 'Agriculture and Food Authority',
    link: 'data:image/jpeg;base64,'
  },
  {
    name: 'Avocado Society of Kenya',
    link: 'data:image/jpeg;base64,'
  },
  {
    name: 'Global Standards Resource',
    link: 'data:image/png;base64,'
  },
  {
    name: 'Janta',
    link: 'data:image/jpeg;base64,'
  },
  {
    name: 'Maersk',
    link: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRu3fPYK_EYpYVmjACIrZB-kb7JXjX76d-N_g&s'
  },
  {
    name: 'APL Logistics',
    link: 'data:image/png;base64,'
  },
  {
    name: 'DHL',
    link: 'data:image/png;base64,'
  }
];

export default function Partners() {
  const [activeIndex, setActiveIndex] = React.useState(0);

  React.useEffect(() => {
    const interval = setInterval(() => {
      setActiveIndex((current) => (current + 1) % partners.length);
    }, 3000);
    return () => clearInterval(interval);
  }, []);

  return (
    <div id="partners" className="py-20 bg-gray-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <h2 className="text-3xl font-bold text-gray-900 text-center mb-12">Our Partners</h2>
        <div className="relative overflow-hidden h-50">
          <div
            className="flex transition-transform duration-500 ease-in-out"
            style={{
              transform: `translateX(-${activeIndex * 100}%)`,
            }}
          >
            {partners.map((partner, index) => (
              <div
                key={index}
                className="min-w-full flex flex-col items-center justify-center text-xl font-semibold text-gray-700"
              >
                <img src={partner.link} alt={partner.name} className="h-15 mr-4" />
                {partner.name}
              </div>
            ))}
          </div>
        </div>

        <div className="flex justify-center mt-8 space-x-2">
          {partners.map((_, index) => (
            <button
              key={index}
              className={`w-3 h-3 rounded-full ${
                index === activeIndex ? 'bg-green-600' : 'bg-gray-300'
              }`}
              onClick={() => setActiveIndex(index)}
            />
          ))}
        </div>
      </div>
    </div>
  );
}